import React, { Component } from "react";
import Prism from "prismjs";
import { Grid, Paper, withStyles, List } from "@material-ui/core";

import "../../ReactJs/styles.css";
import Sidebar from "../sidebar";
import PrismCode from "../../ReactJs/prismCode";

const titles = { backgroundColor: "#F0F8FF", padding: "1px", fontSize: "16px" };

const styles = (theme) => ({
  paper: {
    margin: theme.spacing(1),
    padding: theme.spacing(1),
  },
  smMargin: {
    margin: theme.spacing(1),
  },
  actionDiv: {
    textAlign: "center",
  },
});

const evalRPN = `
function policeNotation(tokens) {
  const stack = [];
  for (const tok of tokens) {
    if (!isNaN(tok)) {
      stack.push(parseInt(tok));
    } else {
      const b = stack.pop();
      const a = stack.pop();
      switch (tok) {
        case "+":
          stack.push(a + b);
          break;
        case "*":
          stack.push(a * b);
          break;
        case "-":
          stack.push(a - b);
          break;
        case "/":
          stack.push(a / b);
          break;
      }
    }
  }
  return stack.pop();
}

console.log(policeNotation(["2", "1", "+", "3", "*"]));
`.trim();

const convertToTitle = `

`.trim();

const combinationSum3 = `
function combiSum(arr, num) {
  const result = [];
  for (let i = 0; i < arr.length; i++) {
    for (let j = i; j < arr.length; j++) {
      if (arr[i] + arr[j] == num) {
        result.push([arr[i], arr[j]]);
      }
    }
  }
  console.log(result);
}

combiSum([2, 1, 4, 3, 5], 7);
`.trim();

const countDigitOne = `
function countOnes(n) {
  let count = 0;
  for (let i = 0; i <= n; i++) {
    count += i.toString().split("1").length - 1;
  }
  return console.log(count);
}

countOnes(16);

`.trim();

const maxSlidingWindow = `
function maxSlidingWindow (nums = [], k){
  if (!nums.length) return [];

  const result = []
  const queue = []

  for (let i = 0; i < k; i++) {
    while (nums[i] > nums[queue[queue.length - 1]]) {
      queue.pop()
    }
    queue.push(i)
  }
  result.push(nums[queue[0]])

  for (let i = 1; i < nums.length - k + 1; i++) {
    if (queue[0] < i) {
      queue.shift()
    }
    while (nums[i + k - 1] > nums[queue[queue.length - 1]]) {
      queue.pop()
    }
    queue.push(i + k - 1)
    result.push(nums[queue[0]])
  }
  return result
}

console.log(maxSlidingWindow([1,3,-1,-3,5,3,6,7], 3))
`.trim();

class TopTech extends Component {
  componentDidMount() {
    setTimeout(() => Prism.highlightAll(), 0);
  }
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Grid item xs={2}>
          <Paper className={classes.paper}>
            <h4>
              <Sidebar />
            </h4>
          </Paper>
        </Grid>
        <Grid item xs={10}>
          <Paper className={classes.paper}>
            <List>
              <h3>1. Find the longest common prefix string amongst an array of strings.</h3>
              <div style={titles}>
                <PrismCode
                  code={convertToTitle}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>2. Evaluate Reverse Polish Notation</h3>
              <b>Input: </b>["2", "1", "+", "3", "*"]
              <br />
              <b>Output: </b>9<br />
              <b>Explanation: </b>((2 + 1) * 3) = 9
              <div style={titles}>
                <PrismCode
                  code={evalRPN}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>3. Combination Sum.</h3>
              Find all possible combinations of k numbers that add up to a
              number n, given that only numbers from 1 to 9 can be used and each
              combination should be a unique set of numbers.
              <br />
              <b>Note: </b>
              <ul>
                <li>All numbers will be positive integers.</li>
                <li>
                  The solution set must not contain duplicate combinations.
                </li>
              </ul>
              <div style={titles}>
                <PrismCode
                  code={combinationSum3}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>4. Number of Digit One.</h3>
              Given an integer n, count the total number of digit 1 appearing in
              all non-negative integers less than or equal to n.
              <br/>
              <ul>
                <li><b>Time complexity: </b>O(n), where n is the input number. This is because the countOnes() function iterates over the numbers from 0 to n, and each iteration takes constant time.</li><br/>
                <li><b>Space complexity: </b>O(1), where n is the input number. This is because the countOnes() function only uses a constant amount of memory to store the variables count, i, and str.</li><br/>
                <li>In simple words, the countOnes() function takes a linear amount of time to run, and it uses a constant amount of space.</li>
              </ul>
              <div style={titles}>
                <PrismCode
                  code={countDigitOne}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>5. Sliding Window Maximum.</h3>
              Given an array nums, there is a sliding window of size k which is
              moving from the very left of the array to the very right. You can
              only see the k numbers in the window. Each time the sliding window
              moves right by one position. Return the max sliding window.
              <br />
              <br />
              Could you solve it in linear time?
              <div style={titles}>
                <PrismCode
                  code={maxSlidingWindow}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
            </List>
          </Paper>
        </Grid>
      </Grid>
    );
  }
}

export default withStyles(styles)(TopTech);
